import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'
import "./NavBar.css"
import { AppBar, Toolbar, Typography, Button } from "@mui/material"
//import WalletConnector from './WalletConnector'

class NavBar extends Component {
  render() {
    const GotoExchange = withRouter(({ history }) => (
      <button className="btn btn-outlined"
        onClick={() => { history.push('/exchange') }}
      >
        Exchange
      </button>
    ))
    const GotoHome = withRouter(({ history }) => (
      <button className="btn btn-outlined"
        onClick={() => { history.push('/') }}
      >
        Exchange
      </button>
    ))

    return (
      <div className="flex fixed w-full bg-blue">
        <h6 className="text-white font-semibold">Deez Token Trader</h6>
        <div className="ml-2">
          <GotoHome />
          <GotoExchange />
        </div>
        {/*<WalletConnector handleConnect={this.props.handleConnect}/>*/}
      </div>
    )
  }
}

export default NavBar
